import {
  ContinuousSlider,
  VolumeDown,
  VolumeUp,
} from "./components/volumeControler/index";
import "./App.scss";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <ContinuousSlider>
            <VolumeDown />
            <VolumeUp />
          </ContinuousSlider>
        </p>
      </header>
    </div>
  );
}

export default App;
